#!/usr/bin/env python

def ListSplit(src): #split skus into list
	dst = src.split(',')
	return dst

def NewTop(sku,list):
	p = [x for x,i in enumerate(list) if i == sku] #look for position of sku at bottom of NWAR
	pos_next = p[0] + 1 #add one, thereby getting the new top of the next page
	return list[pos_next:]
	
def OverlayList(new,old):
	sku_merge = old[0] #first sku of old list
	p = [x for x,i in enumerate(new) if i == sku_merge] #look for position of merge sku in the remnants of the previous list
	pos = p[0] #actual position of sku
	new_add = new[:pos]
	res = new_add + old
	return res	
	
